import React from "react";
import "../CSS/Style.css"

function Error(){
    return(
        <>
        <div className="Error">
        <h2> Something gone Wrong... </h2>
        <img src='https://www.pngitem.com/pimgs/m/495-4953880_error-symbol-hd-png-download.png' alt="#" className="Errorimg"></img>
        </div>
        </>
    );
}
 export default Error;
